/**
 * A word list to lookup Thai words which have ambiguous spellings.
 * This class was made for lookups after finding out how ambiguous Thai spelling is.
 * The list itself is generated from a dictionary and finding ambiguous spellings
 * before putting a word into the list.
 */
class ThaiWordList {

	/**
	 * Length of longest word in the list.
	 * @var integer Length of longest word in the list.
	 */
	private static $MAX_WORD_LENGTH = 0;

	/**
	 * Maximum number of syllables for any word in the list.
	 * @var integer Maximum number of syllables for any word in the list.
	 */
	private static $MAX_SYLLABLES = 0;

	/**
	 * The word list array structure.
	 * @var array the word list lookup tree.
	 */
	private static $word_list = null;

	/**
	 * An array of word lengths in each sublist for each of the starting Thai letters.
	 * @var  array  An array of word lengths in each sublist for each of the starting Thai letters.
	 */
	private static $word_list_counts = 0;

	/**
	 * Returns an array of matching words for specified input string.
	 * @param  string  $str  The Thai input string.
	 * @param  integer $off  Offset in $str in which to start matching.
	 * @param  integer $maxlen  Maximum length to check for a match.
	 * @return array  An array of ThaiWord matching the input.
	 */
	public static function getMatchingWords($str, $off, $maxlen = -1) {
		$first_char_code = mb_ord(mb_substr($str, $off, 1));
		$c = ThaiSymbol::fromCharCode($first_char_code);
		if (!$c) {
			return false; // something wrong...
		}
		$first_char_code -= ThaiSymbol::$MIN_CODE;
		if (!self::$word_list[$first_char_code]) {
			return false;
		}
		if ($maxlen < 0) {
			$maxlen = mb_strlen($str) - $off;
		}
		if ($maxlen > self::$MAX_WORD_LENGTH) {
			$maxlen = self::$MAX_WORD_LENGTH;
		}
		$matches = array();
		$chars = '';
		$biggest_match = null;
		$biggest_match_len = 0;
		for ($n = 1; $n <= $maxlen; $n++) {
			$chars .= mb_substr($str, $off + $n - 1, 1);
			$count = self::$word_list_counts[$first_char_code][$n];
			for ($j = 0; $j < $count; $j++) {
				if ($chars == self::$word_list[$first_char_code][$n][$j]->chars) {
					//if (mb_strlen($chars) > $biggest_match_len) {
					//    $biggest_match = self::$word_list[$first_char_code][$n][$j];
					//    $biggest_match_len = mb_strlen($chars);
					//}
					array_push($matches, self::$word_list[$first_char_code][$n][$j]);
					//break;
				}
			}
		}
		//if ($biggest_match) {
		//    return array(0 => $biggest_match);
		//} else {
			return $matches;
		//}
	}


	/**
	 * Not currently used.  Returns a word from input which matches the specified syllables.
	 */
	public static function getMatchingWordsBySyllable($str, $arg, $off, $len, $syllables, $syllable_off = 0) {
		$num_syllables = count($syllables) - $syllable_off;
		$first_char_code = mb_ord(mb_substr($str, $off, 1));
		$c = ThaiSymbol::fromCharCode($first_char_code);
		if (!$c) {
			return false; // something wrong...
		}
		$first_char_code -= ThaiSymbol::$MIN_CODE;
		if (!self::$word_list[$first_char_code]) {
			return false;
		}
		$chars = '';
		$matches = array();
		for ($i = 0; $i < $num_syllables && $i < self::$MAX_SYLLABLES - $syllable_off; $i++) {
			if (!$syllables[$syllable_off + $i]) {
				break;
			}
			$chars .= $syllables[$syllable_off + $i]['chars'];
			$count = self::$word_list_counts[$first_char_code][$i + 1];
			for ($j = 0; $j < $count; $j++) {
				if ($chars == self::$word_list[$first_char_code][$i + 1][$j]->chars) {
					array_push($matches, self::$word_list[$first_char_code][$i + 1][$j]);
					//break;
				}
			}
		}
		return $matches;
	}



